(1, '<div class=\"text\">\r\n<p>Lorem ipsum dolor sit amet consectur adipiscing elit sed eiusmod ex tempor incididunt labore dolore magna aliquaenim ad minim veniam quis nostrud exercitation ullamco laboris.</p>\r\n</div>\r\n\r\n<ul>\r\n	<li>Associates Insurance</li>\r\n	<li>Pina &amp; Insurance</li>\r\n</ul>', '<h1>App Privacy Policy</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This Privacy Policy informs you use our services (including websites and mobile applications), we may collect and use your related information on our services. If the related information was not provided, otherwise you may not register as our user to use some of our services or we may not able to operate effectively and provide you with the best experiences from our services. So we&rsquo;ve developed a Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Use of Personal Information</strong></p>\r\n\r\n<p>We will not collect or store your Personal Information and we will not use, transfer or disclose your Personal Information.</p>\r\n\r\n<p>In the following circumstances, we may disclose your personal information according to your wish or regulations by law:<br />\r\n&ndash; Your prior permission;<br />\r\n&ndash; By the applicable law within or outside your country of residence, legal process, litigation requests;<br />\r\n&ndash; By requests from public and governmental authorities;<br />\r\n&ndash; To protect our legal rights and interests.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Use of Non-Personal Information</strong></p>\r\n\r\n<p>We will not sell, trade, or transfer your information to any third party. We will not combine NonPersonal Information with Personal Information, such as combining your unique User Device number with your name.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Information Security</strong></p>\r\n\r\n<p>We will not collect Personal Information, in the meanwhile we employ administrative, physical and electronic measures designed to protect your Non-Personal Information from unauthorized access and use.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Device Administration</strong></p>\r\n\r\n<p>Screen Lock requires Device Administration permission to be able to lock the device upon user selected events. App does not use the permisson for any other purpose.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Photos/Media&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We may access files on the device such as images and videos.We do not upload this information off your device and SD card.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Contacts&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We may access your contact information for purposes including displaying list.We do not upload this information off your device and SD card.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Storage&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We may collect and store information (including your images and videos) locally on your device using mechanisms such as application data caches.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Camera&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We may access to your camera permission for enabling only photo shoot. We do not utilize your camera for any other purpose.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Calls&nbsp;&nbsp;:</strong>&nbsp;&nbsp;We do not collect any contact information in your device and we only read the contact number in your device to specify the number not in your contact.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Changes to our Privacy Policy</strong></p>\r\n\r\n<p>Our Privacy Policy may change from time to time, we will post any privacy policy changes on this page, so please review it periodically.</p>', '<h1>App Privacy Policy</h1>\r\n\r\n<h1 style=\"text-align:left\"><span style=\"font-size:16px\"><span style=\"font-family:Arial,sans-serif\"><span style=\"color:#000000\"><strong><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">This Privacy Policy informs you use our services (including websites and mobile applications), we may collect and use your related information on our services. If the related information was not provided, otherwise you may not register as our user to use some of our services or we may not able to operate effectively and provide you with the best experiences from our services.</span></span></span></strong></span></span></span></h1>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">Please read this privacy policy carefully as it will help you make informed decisions about sharing your personal information with us.</span></span></span></span></span></span></p>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:18px\"><span style=\"font-family:Arial,sans-serif\"><span style=\"color:#000000\"><strong><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">What information do we collect?</span></span></strong></span></span></span></h1>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">By using the Application, you agree to be bound by our Privacy Policy, which is incorporated into these Terms and Conditions.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">We collect personal information that you voluntarily provide to us when registering at the Application, expressing an interest in obtaining information about us or our products and services, when participating in activities on the Application or otherwise contacting us.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">Though we do our best to protect your personal information, transmission of personal information to and from the Application is at your own risk. You should only access the services within a secure environment. However, please also remember that we cannot guarantee that the internet itself is 100% secure.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">If you use the Application, we may also collect the following information:</span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li style=\"margin-left: 24px; text-align: justify;\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><em><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">Geo-Location Information.</span></span></span></em><strong>&nbsp;</strong><span style=\"font-size:10pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">We may request access or permission to and track location-based information from your mobile device, either continuously or while you are using the Application, to provide location-based services.</span></span></span></span></span></span></span></li>\r\n	<li style=\"margin-left: 24px; text-align: justify;\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><em><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">Mobile Device Access.</span></span></span></em><strong>&nbsp;</strong><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">We may request access or permission to certain features from your mobile device, including your mobile device&rsquo;s [Bluetooth, calendar, camera, contacts, microphone, reminders, sensors, SMS messages, social media accounts, storage,] and other features.</span></span></span></span></span></span></li>\r\n	<li style=\"margin-left: 24px; text-align: justify;\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><em><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">Push Notifications.&nbsp;</span></span></span></em><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">We may request to send you push notifications regarding your account or the mobile application.</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Arial,sans-serif\"><span style=\"color:#000000\"><strong><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">How do we handle your Social Logins?</span></span></strong></span></span></span></h1>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><em><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">If you choose to register or log in to this Application using a social media account, we may have access to certain information about you.</span></span></span></em></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Arial,sans-serif\"><span style=\"color:#000000\"><strong><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">How do we use your information?</span></span></strong></span></span></span></h1>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">We process your information for purposes based on legitimate business interests, the fulfilment of our contract with you and compliance with our legal obligations.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Arial,sans-serif\"><span style=\"color:#000000\"><strong><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">Will your information be shared with anyone?</span></span></strong></span></span></span></h1>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">We only share information with your consent, to comply with laws, to protect your rights, or to fulfil business obligations.</span></span></span></span></span></span></p>\r\n\r\n<h1 style=\"text-align:justify\">&nbsp;</h1>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Arial,sans-serif\"><span style=\"color:#000000\"><strong><span style=\"font-family:Calibri,sans-serif