privacy policy.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Arial,sans-serif\"><span style=\"color:#000000\"><strong><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">What is our stance on Third-Party Websites?</span></span></strong></span></span></span></h1>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">We are not responsible for the safety of any information that you share with third-party websites and any problems that may cause you while you are on third-party websites.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<h1 style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Arial,sans-serif\"><span style=\"color:#000000\"><strong><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">Can this Policy Change?</span></span></strong></span></span></span></h1>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><em><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">Yes,&nbsp;</span></span></span></em><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">we reserve the right, in our sole discretion, to make changes or modifications to these Privacy Polices at any time and for any reason. It is your responsibility to periodically review these Privacy Policies to stay informed of updates. You will be subject to, and will be deemed to have been made aware of and to have accepted, the changes in any revised Privacy Policies by your continued use of the Application after the date such revised Policies are posted.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">Any person or&nbsp;any body&nbsp;who uses the Application&rsquo;s name, logo or any part of it without our approval is solely responsible for its/his/her/their act. We shall bear no responsibility for such act. &ldquo;We bring Restaurants at your table&rdquo; is a simple sentence only.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:medium\"><span style=\"font-family:&quot;Times New Roman&quot;,serif\"><span style=\"color:#000000\"><span style=\"font-size:10pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">IF YOU DO NOT AGREE WITH ALL OF THESE PRIVACY POLICIES, THEN YOU ARE EXPRESSLY PROHIBITED FROM USING THIS APPLICATION AND YOU MUST DISCONTINUE USE IMMEDIATELY.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<h2 style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Arial,sans-serif\"><span style=\"color:#000000\"><strong><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">Credit &amp; Contact Information</span></span></strong></span></span></span></h2>\r\n\r\n<h2 style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Arial,sans-serif\"><span style=\"color:#000000\"><strong><span style=\"font-family:Calibri,sans-serif\"><span style=\"color:black\">This Privacy Policy page was cr