(148, 1, 'en', 'description', '<div class=\"about-history-1\">\r\n<p style=\"text-align:center\"><span style=\"font-size:20px\"><strong>The History</strong></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The&nbsp;History of Website&nbsp;and Cooks gives further intimation on Mr. Boulanger&#39;s usual menu, stating confidently that &quot;Boulanger served salted poultry and fresh eggs, all presented without a tablecloth on small marble tables&quot;. Numerous commentators have also referred to the supposed restaurant owner&#39;s eccentric habit of touting for custom outside his establishment, dressed in aristocratic fashion and brandishing a sword</p>\r\n\r\n<p style=\"text-align:justify\">According to Miss Spang, there is not a shred of evidence for any of it. She sai<img alt=\"\" src=\"http://192.168.1.118/project/ecommerce_new/Ecommerce/images/bag-about.png\" style=\"float:right; height:202px; width:200px\" />d: These legends just get passed on by hearsay and then spiral out of control. Her interest in dates back to a history of food seminar in Paris in the mid-1990s</p>\r\n</div>', '2021-07-17 16:09:12', '2021-07-20 11:31:29', 'Pages'),
(149, 1, 'ar', 'page_name', 'معلومات عنا', '2021-07-17 16:09:12', '2021-07-17 16:09:12', 'Pages'),
(150, 1, 'ar', 'description', '<p>&lt;div class=&quot;about-history-1&quot;&gt;<br />\r\n&lt;p style=&quot;text-align:center&quot;&gt;&lt;span style=&quot;font-size:20px&quot;&gt;&lt;strong&gt;التاريخ&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;</p>\r\n\r\n<p>&lt;p&gt;&amp;nbsp;&lt;/p&gt;</p>\r\n\r\n<p>&lt;p&gt;Tيقدم هو &amp; nbsp؛ History of Website &amp; nbsp؛ and Cooks مزيدًا من الإيحاء حول قائمة السيد بولانجر المعتادة ، موضحًا بثقة أن &amp; quot؛ بولانجر يقدم دواجن مملحة وبيضًا طازجًا ، وكلها مقدمة بدون مفرش على طاولات رخامية صغيرة &amp; quot ؛. أشار العديد من المعلقين أيضًا إلى عادة غريبة الأطوار لمالك المطعم المفترض أنها تروج للعادات خارج مؤسسته ، مرتديًا أزياء أرستقراطية ويلوح بالسيف&lt;/p&gt;</p>\r\n\r\n<p>&lt;p style=&quot;text-align:justify&quot;&gt;وفقًا لملكة جمال سبانج ، لا يوجد دليل على أي منها. إنها ساي &lt;img alt = &quot;&quot; src = &quot;http://192.168.1.118/project/ecommerce_new/Ecommerce/images/bag-about.png&quot; style = &quot;float: right؛ height: 202px؛ width: 200px&quot; /&gt; د: يتم نقل هذه الأساطير عن طريق الإشاعات ثم تخرج عن نطاق السيطرة. يعود اهتمامها بها إلى ندوة عن تاريخ الطعام في باريس في منتصف التسعينيات&lt;/p&gt;<br />\r\n&lt;/div&gt;</p>', '2021-07-17 16:09:12', '2021-07-20 11:31:29', 'Pages'),
