(696, 2, 'en', 'name', 'Quinces', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(697, 2, 'en', 'description', '<p>Quince plants are much-branched shrubs or small trees and have entire&nbsp;leaves&nbsp;with small stipules (small leafy outgrowths on either side of the leafstalk). They bear large, solitary, white or pink&nbsp;flowers&nbsp;that are similar to those of the&nbsp;pear&nbsp;or&nbsp;apple&nbsp;but feature leafy calyx lobes and a many-celled ovary. The&nbsp;fruit&nbsp;is a golden yellow pome and may be round and flattened or somewhat pear-shaped.</p>', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(698, 2, 'en', 'meta_keyword', 'Quinces', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(699, 2, 'en', 'colorname', 'yellow', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(700, 2, 'ar', 'name', 'السفرجل', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(701, 2, 'ar', 'description', '<p>نباتات السفرجل عبارة عن شجيرات متفرعة أو أشجار صغيرة ولها أوراق كاملة بنصوص صغيرة (نواتج مورقة صغيرة على جانبي ساق الأوراق). إنها تحمل أزهارًا كبيرة أو منفردة أو بيضاء أو وردية تشبه أزهار الكمثرى أو التفاح ولكنها تتميز بفصوص الكأس الورقية ومبيض متعدد الخلايا. الثمرة عبارة عن قبة صفراء ذهبية وقد تكون مستديرة ومسطحة أو على شكل كمثرى إلى حد ما.</p>', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(702, 2, 'ar', 'meta_keyword', 'السفرجل', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(703, 2, 'ar', 'colorname', 'yellow', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(704, 2, 'sp', 'name', 'Membrillos', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(705, 2, 'sp', 'description', '<p>Las plantas de membrillo son arbustos muy ramificados o &aacute;rboles peque&ntilde;os y tienen hojas enteras con peque&ntilde;as est&iacute;pulas (peque&ntilde;as excrecencias frondosas a ambos lados del tallo de la hoja). Tienen flores grandes, solitarias, blancas o rosadas que son similares a las de la pera o la manzana, pero presentan l&oacute;bulos frondosos del c&aacute;liz y un ovario multicelular. La fruta es una pepita de color amarillo dorado y puede ser redonda y aplanada o algo en forma de pera.</p>', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(706, 2, 'sp', 'meta_keyword', 'Membrillos', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(707, 2, 'sp', 'colorname', 'yellow', '2021-09-11 11:08:11', '2021-09-11 11:08:11', 'Product'),
(708, 3, 'en', 'name', 'Watermelon', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(709, 3, 'en', 'description', '<p>Watermelons are native to Africa, where the fruits have been cultivated for consumption for over 4,000 years. There are now in excess of 1,200 watermelon cultivars, which produce fruits varying in size from 6 pounds to 50 pounds. All of these types of watermelons have common features, including firm outer rinds and soft inner flesh which is dotted throughout with seeds.</p>\r\n\r\n<p>Watermelons have an extremely high water content, somewhere in the region of 90%, and this is where their name comes from. The high water content makes for a refreshing snack in the summer, and because of its large size, it remains cool even after being removed from the refrigerator.</p>\r\n\r\n<p>Watermelons are a very popular fruit and are widely cultivated around the world for consumers. China accounts for 70% of watermelon production, while Brazil, Turkey, and Iran are also key producers. In the United States, over 40 states are producing commercial watermelons, as they are able to be grown in a wide variety of climates as an annual plant, though they thrive in hotter climates.</p>\r\n\r\n<p>Watermelons should be grown in well-draining soil as they are intolerant of soggy conditions. They grow on hairy vines which trail along the ground, producing hairy foliage and pale green flowers in July and August.</p>', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(710, 3, 'en', 'meta_keyword', 'Watermelon', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(711, 3, 'en', 'colorname', 'red', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(712, 3, 'ar', 'name', 'بطيخ', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(713, 3, 'ar', 'description', '<p>يعود أصل البطيخ إلى إفريقيا ، حيث تمت زراعة الثمار للاستهلاك منذ أكثر من 4000 عام. يوجد الآن ما يزيد عن 1200 صنف من البطيخ ، والتي تنتج ثمارًا يتراوح حجمها من 6 أرطال إلى 50 رطلاً. كل هذه الأنواع من البطيخ لها سمات مشتركة ، بما في ذلك القشور الخارجية الصلبة واللب الداخلي الناعم المنقَّط بالبذور.</p>\r\n\r\n<p>يحتوي البطيخ على نسبة عالية جدًا من الماء ، في مكان ما في المنطقة بنسبة 90 ٪ ، وهذا هو مصدر اسمه. المحتوى المائي العالي يجعل وجبة خفيفة منعشة في الصيف ، وبسبب حجمها الكبير فإنها تظل باردة حتى بعد إخراجها من الثلاجة.</p>\r\n\r\n<p>البطيخ فاكهة شائعة جدًا ويتم زراعتها على نطاق واسع في جميع أنحاء العالم للمستهلكين. تمثل الصين 70٪ من إنتاج البطيخ ، بينما تعد البرازيل وتركيا وإيران منتجين رئيسيين. في الولايات المتحدة ، تنتج أكثر من 40 ولاية بطيخًا تجاريًا ، حيث يمكن زراعتها في مجموعة متنوعة من المناخات كنبات سنوي ، على الرغم من أنها تزدهر في المناخات الأكثر حرارة.</p>\r\n\r\n<p>يجب أن ينمو البطيخ في تربة جيدة التصريف لأنها لا تتحمل الظروف المبللة. تنمو على أشجار العنب التي تمتد على طول الأرض ، وتنتج أوراقًا مشعرة وأزهارًا خضراء شاحبة في شهري يوليو وأغسطس.</p>', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(714, 3, 'ar', 'meta_keyword', 'Watermelon', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(715, 3, 'ar', 'colorname', 'red', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(716, 3, 'sp', 'name', 'Sandía', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(717, 3, 'sp', 'description', '<p>Las sand&iacute;as son originarias de &Aacute;frica, donde las frutas se han cultivado para el consumo durante m&aacute;s de 4.000 a&ntilde;os. Ahora hay m&aacute;s de 1200 variedades de sand&iacute;a, que producen frutos que var&iacute;an en tama&ntilde;o de 6 libras a 50 libras. Todos estos tipos de sand&iacute;as tienen caracter&iacute;sticas comunes, que incluyen c&aacute;scaras exteriores firmes y pulpa interior suave salpicada de semillas.</p>\r\n\r\n<p>Las sand&iacute;as tienen un contenido de agua extremadamente alto, en alg&uacute;n lugar del 90%, y de ah&iacute; proviene su nombre. El alto contenido de agua lo convierte en un refrigerio refrescante en el verano y, debido a su gran tama&ntilde;o, permanece fresco incluso despu&eacute;s de sacarlo del refrigerador.</p>\r\n\r\n<p>Las sand&iacute;as son una fruta muy popular y se cultivan ampliamente en todo el mundo para los consumidores. China representa el 70% de la producci&oacute;n de sand&iacute;a, mientras que Brasil, Turqu&iacute;a e Ir&aacute;n tambi&eacute;n son productores clave. En los Estados Unidos, m&aacute;s de 40 estados est&aacute;n produciendo sand&iacute;as comerciales, ya que pueden cultivarse en una amplia variedad de climas como planta anual, aunque prosperan en climas m&aacute;s c&aacute;lidos.</p>\r\n\r\n<p>Las sand&iacute;as deben cultivarse en un suelo bien drenado, ya que son intolerantes a las condiciones empapadas. Crecen en enredaderas peludas que se arrastran por el suelo, produciendo follaje peludo y flores de color verde p&aacute;lido en julio y agosto.</p>', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(718, 3, 'sp', 'meta_keyword', 'Watermelon', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(719, 3, 'sp', 'colorname', 'red', '2021-09-11 11:15:36', '2021-09-11 11:15:36', 'Product'),
(720, 4, 'en', 'name', 'Casaba Melon', '2021-09-11 11:26:32', '2021-09-11 11:26:32', 'Product'),
(721, 4, 'en', 'description', '<p>The Casaba Melon is another melon hailing from the inodorous variety, which are commonly known as muskmelons. Although very closely related to the honeydew melon and cantaloupe melon, this type of melon does not have a sweet taste or obvious aroma. It is more comparable in terms of taste to a cucumber and Asian pear.</p>\r\n\r\n<p>Casaba melons have a very unique look and can be instantly identified from their exterior. They have a round shape that comes to a defined point at one end, with a thick deeply ridged rind. The ridges run in stripes from end to end on a bright yellow skin that is sometimes flecked with green. The thick rind helps to protect the soft inner flesh and gives it a long shelf life. It is grouped along with other melons that have a long shelf life, which are known as &lsquo;winter melons&rsquo;. Although they are grown in the summer, they are called &lsquo;winter melons&rsquo; because they are able to keep for several months and in days gone by were some of the only melons available for eating during the winter.</p>', '2021-09-11 11:26:32', '2021-09-11 11:26:32', 'Product'),
(722, 4, 'en', 'meta_keyword', 'Casaba Melon', '2021-09-11 11:26:32', '2021-09-11 11:26:32', 'Product'),
(723, 4, 'en', 'colorname', 'green', '2021-09-11 11:26:32', '2021-09-11 11:26:32', 'Product'),
(724, 4, 'ar', 'name', 'كاسابا بطيخ', '2021-09-11 11:26:32', '2021-09-11 11:26:32', 'Product'),
(725, 4, 'ar', 'description', '<p>Casaba Melon هو نوع آخر من البطيخ ينحدر من الصنف غير الرائحة ، والذي يُعرف باسم شمام الشمام. على الرغم من ارتباطه الوثيق بشمام المن البطيخ والشمام ، إلا أن هذا النوع من البطيخ ليس له طعم حلو أو رائحة واضحة. إنه أكثر قابلية للمقارنة من حيث الذوق بالخيار والكمثرى الآسيوية.</p>\r\n\r\n<p>تتميز شمام الكاسابا بمظهر فريد للغاية ويمكن التعرف عليها على الفور من الخارج. لها شكل دائري يصل إلى نقطة محددة في أحد طرفيها ، مع قشرة سميكة عميقة النتوء. تمتد الحواف في خطوط من النهاية إلى النهاية على جلد أصفر لامع يتخلله أحيانًا اللون الأخضر. تساعد القشرة السميكة على حماية اللب الداخلي الناعم وتعطيه مدة صلاحية طويلة. يتم تجميعها جنبًا إلى جنب مع أنواع البطيخ الأخرى التي لها مدة صلاحية طويلة ، والتي تُعرف باسم &quot;البطيخ الشتوي&quot;. على الرغم من أنها تزرع في الصيف ، إلا أنها تسمى &quot;البطيخ الشتوي&quot; لأنها قادرة على الاحتفاظ بها لعدة أشهر وفي الأيام الماضية كانت بعض البطيخ الوحيد المتاح للأكل خلال فصل الشتاء.</p>', '2021-09-11 11:26:32', '2021-09-11 11:26:32', 'Product'),
(726, 4, 'ar', 'meta_keyword', 'كاسابا بطيخ', '2021-09-11 11:26:32', '2021-09-11 11:26:32', 'Product'),
(727, 4, 'ar', 'colorname', 'green', '2021-09-11 11:26:32', '2021-09-11 11:26:32', 'Product'),
(728, 4, 'sp', 'name', 'Melón Casaba', '2021-09-11 11:26:32', '2021-09-11 11:26:32', 'Product'),
(729, 4, 'sp', 'description', '<p>El mel&oacute;n Casaba es otro mel&oacute;n procedente de la variedad inodoro, que se conocen com&uacute;nmente como melones. Aunque est&aacute; muy relacionado con el mel&oacute;n dulce y el mel&oacute;n cantalupo, este tipo de mel&oacute;n no tiene un sabor dulce ni un aroma evidente. Es m&aacute;s comparable en t&eacute;rminos de sabor a un pepino y una pera asi&aacute;tica.</p>\r\n\r\n<p>Los melones Casaba tienen un aspecto &uacute;nico y se pueden identificar instant&aacute;neamente desde su exterior. Tienen una forma redonda que llega a un punto definido en un extremo, con una corteza gruesa y profundamente estriada. Las crestas corren en franjas de un extremo a otro sobre una piel de color amarillo brillante que a veces est&aacute; moteada de verde. La corteza gruesa ayuda a proteger la pulpa interior blanda y le da una larga vida &uacute;til. Se agrupa junto con otros melones que tienen una larga vida &uacute;til, que se conocen como &quot;melones de invierno&quot;. Aunque se cultivan en verano, se les llama &quot;melones de invierno&quot; porque pueden conservarse durante varios meses y en el pasado eran algunos de los &uacute;nicos melones disponibles para comer durante el invierno.</p>', '2021-09-11 11:26:32', '2021-09-11 11:26:32', 'Product'),
(730, 4, 'sp', 'meta_keyword', 'Melón Casaba', '2021-09-11 11:26:32', '2021-09-11 11:26:32', 'Product'),
(731, 4, 'sp', 'colorname', 'green', '2021-09-11 11:26:33', '2021-09-11 11:26:33', 'Product'),
(732, 5, 'en', 'name', 'Wild Alaskan Salmon', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(733, 5, 'en', 'description', '<p>As authentic as it gets! Get a taste of the Atlantic waters with Topchop mom&#39;s certified Atlantic Salmon fillets. Get the ultimate ticket to luxury as they offer you their characteristically rich and delicate oily flavour with every bite. Nutritious and delicious, there won&#39;t be a morsel that you&#39;d not relish.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>* The images used on site are for referential purposes and not the actual photograph.</p>', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(734, 5, 'en', 'meta_keyword', 'Wild Alaskan Salmon', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(735, 5, 'en', 'colorname', 'red', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(736, 5, 'ar', 'name', 'سلمون ألاسكا البري', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(737, 5, 'ar', 'description', '<p>أصلية كما تحصل! تذوق طعم مياه المحيط الأطلسي مع شرائح السلمون الأطلسية المعتمدة من Topchop mom. احصل على التذكرة النهائية للرفاهية لأنها تقدم لك نكهتها الزيتية الغنية والرقيقة المميزة مع كل قضمة. مغذي ولذيذ ، لن يكون هناك لقمة لن تستمتع بها.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>* الصور المستخدمة في الموقع لأغراض مرجعية وليست الصورة الفعلية.</p>', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
(738, 5, 'ar', 'meta_keyword', 'سلمون ألاسكا البري', '2021-09-11 11:33:35', '2021-09-11 11:33:35', 'Product'),
