(843, 13, 'sp', 'description', '<p>El pollo katsu es un pollo deshuesado con costra de panko que ha sido frito a la perfecci&oacute;n. Muchas personas prefieren el katsu de pollo hecho con pechuga de pollo tierna como una alternativa m&aacute;s saludable al tonkatsu, pero el muslo de pollo con mariposa tambi&eacute;n se usa para una versi&oacute;n m&aacute;s jugosa.</p>', '2021-09-14 04:22:18', '2021-09-14 04:22:18', 'Product'),
