(846, 14, 'en', 'name', 'Pizza Viennese', '2021-09-14 04:42:44', '2021-09-14 04:42:44', 'Product'),
(847, 14, 'en', 'description', '<p>The pizza base is&nbsp;usually smeared with tomato sauce and then topped with mozzarella and Vienna sausages cut into slices. Hailing from the actual birthplace of pizza &ndash; the town of Naples - pizza viennese is especially beloved by children, who are, as most Italians would agree, its primary consumers.</p>', '2021-09-14 04:42:44', '2021-09-14 04:42:44', 'Product'),
