(850, 14, 'ar', 'name', 'بيتزا فيينا', '2021-09-14 04:42:44', '2021-09-14 04:42:44', 'Product'),
(851, 14, 'ar', 'description', '<p>عادة ما يتم تلطيخ قاعدة البيتزا بصلصة الطماطم ثم تعلوها جبن موزاريلا ونقانق فيينا مقطعة إلى شرائح. من مسقط رأس البيتزا الفعلي - مدينة نابولي - البيتزا فيينا محبوبة بشكل خاص من قبل الأطفال ، الذين هم ، كما يتفق معظم الإيطاليين ، مستهلكوها الأساسيون.</p>', '2021-09-14 04:42:44', '2021-09-14 04:42:44', 'Product'),
