(858, 15, 'en', 'name', 'Pizza Carrettiera', '2021-09-14 04:57:36', '2021-09-14 04:57:36', 'Product'),
(859, 15, 'en', 'description', '<p>Pizza carrettiera is&nbsp;a variety of Italian pizza that is traditionally topped with tomato sauce, rapini, pepperoncini, salsiccia, and smoked provolone cheese. Commonly known as pizza salsiccia e friarielli, or sausage and rapini pizza, this pizza variety is one of the most beloved Neapolitan pizzas.</p>', '2021-09-14 04:57:36', '2021-09-14 04:57:36', 'Product'),
