(866, 15, 'sp', 'name', 'Pizza Carrettiera', '2021-09-14 04:57:36', '2021-09-14 04:57:36', 'Product'),
(867, 15, 'sp', 'description', '<p>Pizza carrettiera es una variedad de pizza italiana que tradicionalmente se cubre con salsa de tomate, rapini, pepperoncini, salsiccia y queso provolone ahumado. Com&uacute;nmente conocida como pizza salsiccia e friarielli, o pizza de salchicha y rapini, esta variedad de pizza es una de las pizzas napolitanas m&aacute;s queridas.</p>', '2021-09-14 04:57:36', '2021-09-14 04:57:36', 'Product'),
