(871, 16, 'en', 'description', '<p>Pepperoni is an American variety of salami, made from cured pork and beef seasoned with paprika or other chili pepper. Pepperoni is characteristically soft, slightly smoky, and bright red in color. Thinly sliced pepperoni is a popular pizza topping in American pizzerias.</p>', '2021-09-14 05:32:37', '2021-09-14 05:32:37', 'Product'),
