(874, 16, 'ar', 'name', 'بيبروني', '2021-09-14 05:32:37', '2021-09-14 05:32:37', 'Product'),
(875, 16, 'ar', 'description', '<p>بيبروني هو نوع أمريكي من أنواع السلامي ، مصنوع من لحم الخنزير المقدد ولحم البقر المتبل بالفلفل الحلو أو الفلفل الحار. البيبروني ناعم بشكل مميز ، مدخن قليلاً ، ولونه أحمر ساطع. شرائح الببروني الرقيقة هي بيتزا شهيرة تتصدر في مطاعم البيتزا الأمريكية.</p>', '2021-09-14 05:32:37', '2021-09-14 05:32:37', 'Product'),
