(922, 20, 'ar', 'name', 'زبدة مثقف', '2021-09-14 06:51:18', '2021-09-14 06:51:18', 'Product'),
(923, 20, 'ar', 'description', '<p>الزبدة المزروعة مصنوعة من القشدة المستنبتة. بمعنى آخر ، الكريم الذي يحتوي على مزارع بكتيرية حية وتم تخميره لفترة من الزمن. على غرار الزبادي ، تتميز الزبدة المزروعة بنكهة منعشة قليلاً تميزها عن الزبدة العادية. لها نكهة فريدة تعزز كل شيء تقريبًا.</p>', '2021-09-14 06:51:18', '2021-09-14 06:51:18', 'Product'),
(924, 20, 'ar', 'meta_keyword', 'زبدة مثقف', '2021-09-14 06:51:18', '2021-09-14 06:51:18', 'Product'),
