(926, 20, 'sp', 'name', 'Mantequilla cultivada', '2021-09-14 06:51:18', '2021-09-14 06:51:18', 'Product'),
(927, 20, 'sp', 'description', '<p>La mantequilla cultivada est&aacute; hecha de crema cultivada. En otras palabras, crema que contiene cultivos bacterianos vivos y ha fermentado durante un tiempo. Al igual que el yogur, la mantequilla cultivada tiene un sabor ligeramente &aacute;cido que la distingue de la mantequilla normal. Tiene un sabor &uacute;nico que realza casi todo.</p>', '2021-09-14 06:51:18', '2021-09-14 06:51:18', 'Product'),
(928, 20, 'sp', 'meta_keyword', 'Mantequilla cultivada', '2021-09-14 06:51:18', '2021-09-14 06:51:18', 'Product'),
(929, 20, 'sp', 'colorname', 'Amarilla', '2021-09-14 06:51:18', '2021-09-14 06:51:18', 'Product'),
(930, 21, 'en', 'name', 'Organic Butter', '2021-09-14 07:03:26', '2021-09-14 07:03:26', 'Product'),
(931, 21, 'en', 'description', '<p>&nbsp;</p>\r\n\r\n<p>Grass-fed&nbsp;butter&nbsp;is a good source of vitamin A and the antioxidant beta carotene. It also has a higher proportion of healthy, unsaturated fats and CLA than regular&nbsp;butter. What&#39;s more, it provides vitamin K2, a form of vitamin K that plays an important role in your bone and heart health.</p>', '2021-09-14 07:03:26', '2021-09-14 07:03:26', 'Product'),
(932, 21, 'en', 'meta_keyword', 'Organic Butter', '2021-09-14 07:03:26', '2021-09-14 07:03:26', 'Product'),
(933, 21, 'en', 'colorname', 'Yellow', '2021-09-14 07:03:26', '2021-09-14 07:03:26', 'Product'),
(934, 21, 'ar', 'name', 'زبدة عضوية', '2021-09-14 07:03:26', '2021-09-14 07:03:26', 'Product'),
(935, 21, 'ar', 'description', '<p>الزبدة التي تتغذى على العشب هي مصدر جيد لفيتامين أ ومضادات الأكسدة بيتا كاروتين. كما أنه يحتوي على نسبة أعلى من الدهون الصحية وغير المشبعة و CLA مقارنة بالزبدة العادية. علاوة على ذلك ، فهو يوفر فيتامين K2 ، وهو أحد أشكال فيتامين K الذي يلعب دورًا مهمًا في صحة العظام والقلب.</p>', '2021-09-14 07:03:26', '2021-09-14 07:03:26', 'Product'),
(936, 21, 'ar', 'meta_keyword', 'زبدة عضوية', '2021-09-14 07:03:26', '2021-09-14 07:03:26', 'Product'),
(937, 21, 'ar', 'colorname', 'أصفر', '2021-09-14 07:03:26', '2021-09-14 07:03:26', 'Product'),
(938, 21, 'sp', 'name', 'Mantequilla Orgánica', '2021-09-14 07:03:26', '2021-09-14 07:03:26', 'Product'),
(939, 21, 'sp', 'description', '<p>La mantequilla de animales alimentados con pasto es una buena fuente de vitamina A y betacaroteno antioxidante. Tambi&eacute;n tiene una mayor proporci&oacute;n de grasas insaturadas saludables y CLA que la mantequilla normal. Adem&aacute;s, proporciona vitamina K2, una forma de vitamina K que desempe&ntilde;a un papel importante en la salud de los huesos y el coraz&oacute;n.</p>', '2021-09-14 07:03:26', '2021-09-14 07:03:26', 'Product'),
