(946, 22, 'ar', 'name', 'كرنب', '2021-09-14 07:21:44', '2021-09-14 07:21:44', 'Product'),
(947, 22, 'ar', 'description', '<p>كرنبكرنب هو شكل غير ورقي من الملفوف البري يأتي في مجموعة من الأشكال والأحجام والألوان ، مثل الأزرق والأخضر والأصفر والأخضر والأبيض والأحمر والأرجواني. ... الكالي القياسي الذي نجده عادة في محل البقالة هو شاحب إلى أخضر غامق مع أوراق كبيرة ذات حواف مكشكشة وسيقان طويلة.</p>', '2021-09-14 07:21:44', '2021-09-14 07:21:44', 'Product'),
