(950, 22, 'sp', 'name', 'col rizada', '2021-09-14 07:21:44', '2021-09-14 07:21:44', 'Product'),
(951, 22, 'sp', 'description', '<p>La col rizada es una forma frondosa de repollo silvestre que viene en una variedad de formas, tama&ntilde;os y colores, como azul verdoso, amarillo verdoso, blanco, rojo o morado. ... La col rizada est&aacute;ndar que solemos encontrar en la tienda es de color verde p&aacute;lido a profundo con hojas grandes con bordes de volantes y tallos largos.</p>', '2021-09-14 07:21:44', '2021-09-14 07:21:44', 'Product'),
(952, 22, 'sp', 'meta_keyword', 'col rizada', '2021-09-14 07:21:44', '2021-09-14 07:21:44', 'Product'),
