(966, 24, 'en', 'name', 'Mizuna', '2021-09-14 07:55:18', '2021-09-14 07:55:18', 'Product'),
(967, 24, 'en', 'description', '<p>Mizuna (Brassica rapa var. nipposinica) is&nbsp;a leafy green vegetable&nbsp;that&#39;s native to East Asia (1). It&#39;s also referred to as Japanese mustard greens, spider mustard, or konya (1). ... It has dark green, serrated leaves with thin stems and a peppery, slightly bitter flavor.</p>', '2021-09-14 07:55:18', '2021-09-14 07:55:18', 'Product'),
(968, 24, 'en', 'meta_keyword', 'Mizuna', '2021-09-14 07:55:18', '2021-09-14 07:55:18', 'Product'),
(969, 24, 'en', 'colorname', 'Green', '2021-09-14 07:55:18', '2021-09-14 07:55:18', 'Product'),
(970, 24, 'ar', 'name', 'ميزونا', '2021-09-14 07:55:18', '2021-09-14 07:55:18', 'Product'),
(971, 24, 'ar', 'description', '<p>ميزونا هي خضار ذات أوراق خضراء موطنها شرق آسيا (1). يشار إليها أيضًا باسم الخردل الياباني أو خردل العنكبوت أو قونية ا أوراق خضراء داكنة مسننة ذات سيقان رفيعة ونكهة فلفل مرّة قليلاً.</p>', '2021-09-14 07:55:18', '2021-09-14 07:55:18', 'Product'),
(972, 24, 'ar', 'meta_keyword', 'ميزونا', '2021-09-14 07:55:18', '2021-09-14 07:55:18', 'Product'),
(973, 24, 'ar', 'colorname', 'لون أخضر', '2021-09-14 07:55:18', '2021-09-14 07:55:18', 'Product'),
(974, 24, 'sp', 'name', 'Mizuna', '2021-09-14 07:55:18', '2021-09-14 07:55:18', 'Product'),
(975, 24, 'sp', 'description', '<p>Mizuna (Brassica rapa var. Nipposinica) es una verdura de hoja verde que es originaria del este de Asia (1). Tambi&eacute;n se le conoce como hojas de mostaza japonesa, mostaza ara&ntilde;a o konya (1). ... Tiene hojas dentadas de color verde oscuro con tallos finos y un sabor picante, ligeramente amargo.</p>', '2021-09-14 07:55:18', '2021-09-14 07:55:18', 'Product'),
