(978, 25, 'en', 'name', 'Swiss Chard', '2021-09-14 09:31:38', '2021-09-14 09:31:38', 'Product'),
(979, 25, 'en', 'description', '<p>Swiss Chard has broad leaves and a husky, crisp stalk. The stalk ranges from white to hot pink or red, often called &ldquo;Rainbow Chard&rdquo;, with the leaves darkening towards the tops of the vegetables. The leaves and stalk are both edible.</p>', '2021-09-14 09:31:38', '2021-09-14 09:31:38', 'Product'),
