(982, 25, 'ar', 'name', 'شارد سويسري', '2021-09-14 09:31:38', '2021-09-14 09:31:38', 'Product'),
(983, 25, 'ar', 'description', '<p>يحتوي السلق السويسري على أوراق عريضة وساق هش وهش. تتراوح السيقان من الأبيض إلى الوردي الحار أو الأحمر ، وغالبًا ما يُطلق عليه اسم &quot;شارد قوس قزح&quot; ، مع تغميق الأوراق باتجاه قمم الخضروات. الأوراق والساق كلاهما صالح للأكل.</p>', '2021-09-14 09:31:38', '2021-09-14 09:31:38', 'Product'),
(984, 25, 'ar', 'meta_keyword', 'شارد سويسري', '2021-09-14 09:31:38', '2021-09-14 09:31:38', 'Product'),
(985, 25, 'ar', 'colorname', 'لون أخضر', '2021-09-14 09:31:38', '2021-09-14 09:31:38', 'Product'),
(986, 25, 'sp', 'name', 'Acelga', '2021-09-14 09:31:38', '2021-09-14 09:31:38', 'Product'),
(987, 25, 'sp', 'description', '<p>La acelga tiene hojas anchas y un tallo crujiente y ronco. El tallo var&iacute;a de blanco a rosa fuerte o rojo, a menudo llamado &quot;Acelga arco&iacute;ris&quot;, con las hojas oscureci&eacute;ndose hacia la parte superior de las verduras. Las hojas y el tallo son comestibles.</p>', '2021-09-14 09:31:38', '2021-09-14 09:31:38', 'Product'),
(988, 25, 'sp', 'meta_keyword', 'Acelga', '2021-09-14 09:31:38', '2021-09-14 09:31:38', 'Product'),
