(990, 26, 'en', 'name', 'Beet', '2021-09-14 09:45:04', '2021-09-14 09:45:04', 'Product'),
(991, 26, 'en', 'description', 'Beetroot (Beta vulgaris) is a root vegetable also known as red beet, table beet, garden beet, or just beet. Packed with essential nutrients, beetroots are a great source of fiber, folate (vitamin B9), manganese, potassium, iron, and vitamin C. ... Beetroots are delicious raw but more frequently cooked or pickled.</p>', '2021-09-14 09:45:04', '2022-01-13 08:59:51', 'Product'),
(992, 26, 'en', 'meta_keyword', 'Beet', '2021-09-14 09:45:04', '2021-09-14 09:45:04', 'Product'),
(993, 26, 'en', 'colorname', 'Pink', '2021-09-14 09:45:04', '2021-09-14 09:45:04', 'Product'),
(994, 26, 'ar', 'name', 'الشمندر', '2021-09-14 09:45:04', '2021-09-14 09:45:04', 'Product'),
(995, 26, 'ar', 'description', '<p>الشمندر (Beta vulgaris) هو خضروات جذرية تُعرف أيضًا باسم البنجر الأحمر أو بنجر المائدة أو بنجر الحديقة أو البنجر فقط. معبأ بالعناصر الغذائية الأساسية ، يعتبر الشمندر مصدرًا رائعًا للألياف ، وحمض الفوليك (فيتامين ب 9) ، والمنغنيز ، والبوتاسيوم ، والحديد ، وفيتامين سي ...</p>', '2021-09-14 09:45:04', '2021-09-14 09:45:04', 'Product'),
(996, 26, 'ar', 'meta_keyword', 'الشمندر', '2021-09-14 09:45:04', '2021-09-14 09:45:04', 'Product'),
(997, 26, 'ar', 'colorname', 'لون القرنفل', '2021-09-14 09:45:04', '2021-09-14 09:45:04', 'Product'),
(998, 26, 'sp', 'name', 'Remolacha', '2021-09-14 09:45:04', '2021-09-14 09:45:04', 'Product'),
(999, 26, 'sp', 'description', '<p>La remolacha (Beta vulgaris) es una verdura de ra&iacute;z tambi&eacute;n conocida como remolacha roja, remolacha de mesa, remolacha de jard&iacute;n o simplemente remolacha. Repletas de nutrientes esenciales, las remolachas son una gran fuente de fibra, &aacute;cido f&oacute;lico (vitamina B9), manganeso, potasio, hierro y vitamina C. ... Las remolachas son deliciosas crudas pero con mayor frecuencia cocidas o en escabeche</p>', '2021-09-14 09:45:04', '2021-09-14 09:45:04', 'Product'),
(1000, 26, 'sp', 'meta_keyword', 'Remolacha', '2021-09-14 09:45:04', '2021-09-14 09:45:04', 'Product'),
(1001, 26, 'sp', 'colorname', 'Rosado', '2021-09-14 09:45:04', '2021-09-14 09:45:04', 'Product'),
(1002, 27, 'en', 'name', 'Carrot Orange', '2021-09-14 10:04:33', '2022-01-11 10:54:04', 'Product'),
(1003, 27, 'en', 'description', '<p>Carrot, (Daucus carota), herbaceous, generally biennial plant of the Apiaceae family that produces an edible taproot. Among common varieties root shapes range from globular to long, with lower ends blunt to pointed. Besides the orange-coloured roots, white-, yellow-, and purple-fleshed varieties are known.</p>', '2021-09-14 10:04:33', '2021-09-14 10:04:33', 'Product'),
(1004, 27, 'en', 'meta_keyword', 'Carrott', '2021-09-14 10:04:33', '2022-01-11 11:22:41', 'Product'),
(1005, 27, 'en', 'colorname', 'Orange', '2021-09-14 10:04:33', '2021-09-14 10:04:33', 'Product'),
(1006, 27, 'ar', 'name', 'جزرة', '2021-09-14 10:04:33', '2021-09-14 10:04:33', 'Product'),
(1007, 27, 'ar', 'description', '<p>الجزر ، (Daucus carota) ، عشبي ، نبات كل سنتين بشكل عام من عائلة Apiaceae التي تنتج جذرًا رئيسيًا صالحًا للأكل. من بين الأصناف الشائعة ، تتراوح أشكال الجذر من كروي إلى طويل ، مع نهايات سفلية حادة إلى مدببة. إلى جانب الجذور ذات اللون البرتقالي ، تُعرف أصناف اللحم الأبيض والأصفر والأرجواني.</p>', '2021-09-14 10:04:33', '2021-09-14 10:04:33', 'Product'),
(1008, 27, 'ar', 'meta_keyword', 'جزرة', '2021-09-14 10:04:33', '2021-09-14 10:04:33', 'Product'),
(1009, 27, 'ar', 'colorname', 'البرتقالي', '2021-09-14 10:04:33', '2021-09-14 10:04:33', 'Product'),
(1010, 27, 'sp', 'name', 'Zanahoria', '2021-09-14 10:04:33', '2021-09-14 10:04:33', 'Product'),
(1011, 27, 'sp', 'description', '<p>Zanahoria (Daucus carota), planta herb&aacute;cea, generalmente bianual de la familia Apiaceae que produce una ra&iacute;z primaria comestible. Entre las variedades comunes, las formas de las ra&iacute;ces var&iacute;an de globulares a largas, con los extremos inferiores romos a puntiagudos. Adem&aacute;s de las ra&iacute;ces de color naranja, se conocen variedades de pulpa blanca, amarilla y violeta.</p>', '2021-09-14 10:04:33', '2021-09-14 10:04:33', 'Product'),
(1012, 27, 'sp', 'meta_keyword', 'Zanahoria', '2021-09-14 10:04:33', '2021-09-14 10:04:33', 'Product'),
(1013, 27, 'sp', 'colorname', 'naranja', '2021-09-14 10:04:33', '2021-09-14 10:04:33', 'Product'),
(1014, 28, 'en', 'name', 'Brioche Bread', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1015, 28, 'en', 'description', '<p>&nbsp;</p>\r\n\r\n<p>A brioche is&nbsp;a yeast-raised product enriched with butter and eggs and sometimes sweetened with sugar. This enriched formula gives the finished product a flaky, almost pastry-like texture.</p>', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1016, 28, 'en', 'meta_keyword', 'Brioche Bread', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1017, 28, 'en', 'colorname', 'Red', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1018, 28, 'ar', 'name', 'خبز البريوش', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1019, 28, 'ar', 'description', '<p>البريوش عبارة عن منتج مخمر مخصب بالزبدة والبيض وأحيانًا محلى بالسكر. تمنح هذه التركيبة الغنية المنتج النهائي ملمسًا هشًا يشبه المعجنات تقريبًا.</p>', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1020, 28, 'ar', 'meta_keyword', 'خبز البريوش', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1021, 28, 'ar', 'colorname', 'أحمر', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1022, 28, 'sp', 'name', 'Pan brioche', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1023, 28, 'sp', 'description', '<p>Un brioche es un producto elaborado con levadura enriquecido con mantequilla y huevos y, a veces, endulzado con az&uacute;car. Esta f&oacute;rmula enriquecida le da al producto terminado una textura escamosa, casi como de pasteler&iacute;a.</p>', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1024, 28, 'sp', 'meta_keyword', 'Pan brioche', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1025, 28, 'sp', 'colorname', 'Roja', '2021-09-14 10:29:28', '2021-09-14 10:29:28', 'Product'),
(1026, 29, 'en', 'name', 'Ciabatta Bread', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1027, 29, 'en', 'description', '<p>A ciabatta is an&nbsp;Italian yeast-leavened artisan and hearth-type bread made with a lean formula. It is characterized by having a crisp crust and a large, irregular and open crumb grain (cell structure).</p>', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1028, 29, 'en', 'meta_keyword', 'Ciabatta Bread', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1029, 29, 'en', 'colorname', 'Red', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1030, 29, 'ar', 'name', 'الخبز سياباتا', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1031, 29, 'ar', 'description', '<p>سياباتا هو خبز إيطالي مخمر من الخميرة مصنوع من تركيبة خفيفة. يتميز بقشرة هشة وحبوب فتات كبيرة غير منتظمة ومفتوحة (بنية الخلية).</p>', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1032, 29, 'ar', 'meta_keyword', 'الخبز سياباتا', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1033, 29, 'ar', 'colorname', 'أحمر', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1034, 29, 'sp', 'name', 'Pan de ciabatta', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1035, 29, 'sp', 'description', '<p>Una ciabatta es un pan italiano artesanal con levadura y tipo hogar elaborado con una f&oacute;rmula magra. Se caracteriza por tener una corteza crujiente y un grano de miga grande, irregular y abierto (estructura celular).</p>', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1036, 29, 'sp', 'meta_keyword', 'Pan de ciabatta', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1037, 29, 'sp', 'colorname', 'Roja', '2021-09-14 10:49:00', '2021-09-14 10:49:00', 'Product'),
(1038, 30, 'en', 'name', 'Vanilla cupcakes', '2021-09-14 11:15:17', '2021-09-14 11:15:17', 'Product'),
(1039, 30, 'en', 'description', '<p>Cupcakes have a much softer texture and are easy to bite into. They are never crispy or dense as muffins. And they tend to not have many fillings inside. Muffins have a bit harder texture than cupcakes.</p>', '2021-09-14 11:15:17', '2021-09-14 11:15:17', 'Product');
