(1059, 31, 'sp', 'description', '<p>La historia parece sugerir que la torta de barro se origin&oacute; en los estados del sur de los EE. UU. Cerca del r&iacute;o Mississippi. Se sugiere que se le dio el nombre de Pastel de Lodo a este delicioso pastel, &iquest;creen ustedes porque se parec&iacute;a al lodo a lo largo de las orillas de dicho r&iacute;o?</p>', '2021-09-14 11:39:20', '2021-09-14 11:39:20', 'Product'),
