(1079, 33, 'ar', 'description', '<p>المعروف أيضًا باسم كانتوتشي هو بسكويت اللوز الإيطالي الذي نشأ في مدينة براتو التوسكانية. إنها مخبوزة مرتين ، مستطيلة الشكل ، جافة ، مقرمشة ، ويمكن غمسها في مشروب ، تقليديًا فين سانتو.</p>', '2021-09-14 12:32:48', '2021-09-14 12:32:48', 'Product'),
