(1086, 34, 'en', 'name', 'Grass-Fed Butter', '2021-09-14 13:00:00', '2021-09-14 13:00:00', 'Product'),
(1087, 34, 'en', 'description', '<p>Grass-fed butter comes from&nbsp;cows&nbsp;that are ranged on grasslands during the warm weather, and fed hay in colder months. ... Because grass-fed butter is sourced from cows that feed on green grass, it contains higher levels of conjugated linoleic acid, up to 500% more than cows fed a typical dairy diet.</p>', '2021-09-14 13:00:00', '2021-09-14 13:00:00', 'Product'),
(1088, 34, 'en', 'meta_keyword', 'Grass-Fed Butter', '2021-09-14 13:00:00', '2021-09-14 13:00:00', 'Product'),
