(1090, 34, 'ar', 'name', 'الزبدة العشبية', '2021-09-14 13:00:00', '2021-09-14 13:00:00', 'Product'),
(1091, 34, 'ar', 'description', '<p>تأتي الزبدة التي تتغذى على العشب من الأبقار التي تراوحت في الأراضي العشبية خلال الطقس الدافئ ، وتتغذى على التبن في الأشهر الباردة. ... نظرًا لأن الزبدة التي تتغذى على العشب يتم الحصول عليها من الأبقار التي تتغذى على العشب الأخضر ، فإنها تحتوي على مستويات أعلى من حمض اللينوليك المترافق ، بنسبة تصل إلى ٪ أكثر من الأبقار التي تتغذى على نظام غذائي نموذجي من منتجات الألبان.</p>', '2021-09-14 13:00:00', '2021-09-14 13:00:00', 'Product'),
(1092, 34, 'ar', 'meta_keyword', 'الزبدة العشبية', '2021-09-14 13:00:00', '2021-09-14 13:00:00', 'Product'),
(1093, 34, 'ar', 'colorname', 'أصفر', '2021-09-14 13:00:00', '2021-09-14 13:00:00', 'Product'),
(1094, 34, 'sp', 'name', 'Mantequilla alimentada con pasto', '2021-09-14 13:00:00', '2021-09-14 13:00:00', 'Product'),
(1095, 34, 'sp', 'description', '<p>La mantequilla alimentada con pasto proviene de vacas que se cr&iacute;an en pastizales durante el clima c&aacute;lido y alimentadas con heno en los meses m&aacute;s fr&iacute;os. Debido a que la mantequilla alimentada con pasto proviene de vacas que se alimentan de pasto verde, contiene niveles m&aacute;s altos de &aacute;cido linoleico conjugado, hasta un 500% m&aacute;s que las vacas alimentadas con una dieta l&aacute;ctea t&iacute;pica.</p>', '2021-09-14 13:00:00', '2021-09-14 13:00:00', 'Product'),
(1096, 34, 'sp', 'meta_keyword', 'Mantequilla alimentada con pasto', '2021-09-14 13:00:00', '2021-09-14 13:00:00', 'Product'),
(1097, 34, 'sp', 'colorname', 'Amarilla', '2021-09-14 13:00:00', '2021-09-14 13:00:00', 'Product'),
(1098, 35, 'en', 'name', 'Cultured Butter', '2021-09-14 13:09:17', '2021-09-14 13:09:17', 'Product'),
(1099, 35, 'en', 'description', '<p>Cultured butter is made from cultured cream. In other words,&nbsp;cream that contains live bacterial cultures and has fermented for a period of time. Similar to yogurt, cultured butter has a slightly tangy flavor that sets it apart from regular butter. It has a unique flavor that enhances just about everything.</p>', '2021-09-14 13:09:17', '2021-09-14 13:09:17', 'Product'),
(1100, 35, 'en', 'meta_keyword', 'Cultured Butter', '2021-09-14 13:09:17', '2021-09-14 13:09:17', 'Product'),
(1101, 35, 'en', 'colorname', 'Yellow', '2021-09-14 13:09:17', '2021-09-14 13:09:17', 'Product'),
(1102, 35, 'ar', 'name', 'زبدة مثقف', '2021-09-14 13:09:17', '2021-09-14 13:09:17', 'Product'),
(1103, 35, 'ar', 'description', '<p>الزبدة المزروعة مصنوعة من القشدة المستنبتة. بمعنى آخر ، الكريم الذي يحتوي على مزارع بكتيرية حية وتم تخميره لفترة من الزمن. على غرار الزبادي ، تتميز الزبدة المزروعة بنكهة منعشة قليلاً تميزها عن الزبدة العادية. لها نكهة فريدة تعزز كل شيء تقريبًا.</p>', '2021-09-14 13:09:17', '2021-09-14 13:09:17', 'Product'),
(1104, 35, 'ar', 'meta_keyword', 'زبدة مثقف', '2021-09-14 13:09:17', '2021-09-14 13:09:17', 'Product'),
