(1106, 35, 'sp', 'name', 'Mantequilla cultivada', '2021-09-14 13:09:17', '2021-09-14 13:09:17', 'Product'),
(1107, 35, 'sp', 'description', '<p>La mantequilla cultivada est&aacute; hecha de crema cultivada. En otras palabras, crema que contiene cultivos bacterianos vivos y ha fermentado durante un tiempo. Al igual que el yogur, la mantequilla cultivada tiene un sabor ligeramente &aacute;cido que la distingue de la mantequilla normal. Tiene un sabor &uacute;nico que realza casi todo.</p>', '2021-09-14 13:09:17', '2021-09-14 13:09:17', 'Product'),
