(1122, 37, 'en', 'name', 'Ghee', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1123, 37, 'en', 'description', '<p>Ghee is a form of highly-clarified butter that is traditionally used in Asian cooking. Like butter, ghee is typically made from cow&#39;s milk. ... The butter separates into liquid fats and milk solids. Once separated, the milk solids are removed, which means that ghee has less lactose than butter.</p>', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1124, 37, 'en', 'meta_keyword', 'Ghee', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1125, 37, 'en', 'colorname', 'Yellow', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1126, 37, 'ar', 'name', 'سمن', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1127, 37, 'ar', 'description', '<p>السمن هو شكل من أشكال الزبدة عالية الوضوح التي تستخدم تقليديا في الطبخ الآسيوي. مثل الزبدة ، يصنع السمن عادة من حليب البقر. ... تنفصل الزبدة إلى دهون سائلة وجوامد حليب. بمجرد فصله ، تتم إزالة مواد الحليب الصلبة ، مما يعني أن السمن يحتوي على نسبة أقل من اللاكتوز من الزبدة.</p>', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1128, 37, 'ar', 'meta_keyword', 'سمن', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1129, 37, 'ar', 'colorname', 'أصفر', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1130, 37, 'sp', 'name', 'Ghee', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1131, 37, 'sp', 'description', '<p>Ghee es una forma de mantequilla altamente clarificada que se usa tradicionalmente en la cocina asi&aacute;tica. Al igual que la mantequilla, el ghee se elabora t&iacute;picamente con leche de vaca. ... La mantequilla se separa en grasas l&iacute;quidas y s&oacute;lidos l&aacute;cteos. Una vez separados, los s&oacute;lidos de la leche se eliminan, lo que significa que el ghee tiene menos lactosa que la mantequilla.</p>', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1132, 37, 'sp', 'meta_keyword', 'Ghee', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1133, 37, 'sp', 'colorname', 'Amarilla', '2021-09-15 03:40:40', '2021-09-15 03:40:40', 'Product'),
(1134, 38, 'en', 'name', 'Kale', '2021-09-15 03:50:57', '2021-09-15 03:50:57', 'Product'),
(1135, 38, 'en', 'description', '<p>Kale is&nbsp;a non-heading, leafy form of wild cabbage&nbsp;that comes in a range of shapes, sizes, and colors, such as blue-green, yellow-green, white, red, or purple. ... The standard Kale we usually find in the grocery store is pale to deep green with large, ruffle-edged leaves and long stems.</p>', '2021-09-15 03:50:57', '2021-09-15 03:50:57', 'Product'),
(1136, 38, 'en', 'meta_keyword', 'Kale', '2021-09-15 03:50:57', '2021-09-15 03:50:57', 'Product'),
(1137, 38, 'en', 'colorname', 'Green', '2021-09-15 03:50:57', '2021-09-15 03:50:57', 'Product'),
(1138, 38, 'ar', 'name', 'كرنب', '2021-09-15 03:50:57', '2021-09-15 03:50:57', 'Product'),
(1139, 38, 'ar', 'description', '<p>كرنبكرنب هو شكل غير ورقي من الملفوف البري يأتي في مجموعة من الأشكال والأحجام والألوان ، مثل الأزرق والأخضر والأصفر والأخضر والأبيض والأحمر والأرجواني. ... الكالي القياسي الذي نجده عادة في محل البقالة هو شاحب إلى أخضر غامق مع أوراق كبيرة ذات حواف مكشكشة وسيقان طويلة.</p>', '2021-09-15 03:50:57', '2021-09-15 03:50:57', 'Product'),
(1140, 38, 'ar', 'meta_keyword', 'كرنب', '2021-09-15 03:50:57', '2021-09-15 03:50:57', 'Product'),
