(1142, 38, 'sp', 'name', 'col rizada', '2021-09-15 03:50:57', '2021-09-15 03:50:57', 'Product'),
(1143, 38, 'sp', 'description', '<p>La col rizada es una forma frondosa de repollo silvestre que viene en una variedad de formas, tama&ntilde;os y colores, como azul verdoso, amarillo verdoso, blanco, rojo o morado. ... La col rizada est&aacute;ndar que solemos encontrar en la tienda es de color verde p&aacute;lido a profundo con hojas grandes con bordes de volantes y tallos largos.</p>', '2021-09-15 03:50:57', '2021-09-15 03:50:57', 'Product'),
