(1147, 39, 'en', 'description', '<p>Microgreens are&nbsp;young vegetable greens&nbsp;that are approximately 1&ndash;3 inches (2.5&ndash;7.5 cm) tall. They have an aromatic flavor and concentrated nutrient content and come in a variety of colors and textures (1). Microgreens are considered baby plants, falling somewhere between a sprout and baby green.</p>', '2021-09-15 03:56:38', '2021-09-15 03:56:38', 'Product'),
