(1159, 40, 'en', 'description', '<p>Mizuna (Brassica rapa var. nipposinica) is&nbsp;a leafy green vegetable&nbsp;that&#39;s native to East Asia (1). It&#39;s also referred to as Japanese mustard greens, spider mustard, or konya (1). ... It has dark green, serrated leaves with thin stems and a peppery, slightly bitter flavor.</p>', '2021-09-15 04:07:53', '2021-09-15 04:07:53', 'Product'),
