(1167, 40, 'sp', 'description', '<p>Mizuna (Brassica rapa var. Nipposinica) es una verdura de hoja verde que es originaria del este de Asia (1). Tambi&eacute;n se le conoce como hojas de mostaza japonesa, mostaza ara&ntilde;a o konya (1). ... Tiene hojas dentadas de color verde oscuro con tallos finos y un sabor picante, ligeramente amargo.</p>', '2021-09-15 04:07:53', '2021-09-15 04:07:53', 'Product'),
