(1171, 41, 'en', 'description', '<p>Swiss Chard has broad leaves and a husky, crisp stalk. The stalk ranges from white to hot pink or red, often called &ldquo;Rainbow Chard&rdquo;, with the leaves darkening towards the tops of the vegetables. The leaves and stalk are both edible.</p>', '2021-09-15 04:14:37', '2021-09-15 04:14:37', 'Product'),
