(1194, 43, 'en', 'name', 'apple', '2021-09-15 04:27:07', '2021-09-23 10:01:47', 'Product'),
(1195, 43, 'en', 'description', 'Many gardeners want to&nbsp;grow apples, but they can be difficult to grow well because apple trees are prone to many insect and disease problems. Although new cultivars were bred to be hardy, they still require some spraying, covering, or other protection methods. Apple trees also need a great deal of&nbsp;pruning. When pruning, focus on thinning branches to increase the amount of sunlight and airflow that can hit all parts of the tree. This promotes healthy growth and helps to prevent disease.', '2021-09-15 04:27:07', '2021-09-23 10:01:47', 'Product'),
