(1198, 43, 'ar', 'name', 'تفاح', '2021-09-15 04:27:07', '2021-09-23 10:01:47', 'Product'),
(1199, 43, 'ar', 'description', 'يرغب العديد من البستانيين في زراعة التفاح ، ولكن قد يكون من الصعب نموهم جيدًا لأن أشجار التفاح معرضة للعديد من مشاكل الحشرات والأمراض. على الرغم من أن الأصناف الجديدة قد تم تربيتها لتكون شديدة التحمل ، إلا أنها لا تزال تتطلب بعض طرق الرش أو التغطية أو طرق الحماية الأخرى. تحتاج أشجار التفاح أيضًا إلى قدر كبير من التقليم. عند التقليم ، ركز على ترقق الفروع لزيادة كمية ضوء الشمس وتدفق الهواء الذي يمكن أن يضرب جميع أجزاء الشجرة. هذا يعزز النمو الصحي ويساعد على الوقاية من الأمراض.', '2021-09-15 04:27:07', '2021-09-23 10:01:47', 'Product'),
(1200, 43, 'ar', 'meta_keyword', '#تفاح', '2021-09-15 04:27:07', '2021-09-23 10:01:47', 'Product'),
(1201, 43, 'ar', 'colorname', 'تفاح', '2021-09-15 04:27:07', '2021-09-23 10:01:47', 'Product'),
(1202, 43, 'sp', 'name', 'manzana', '2021-09-15 04:27:07', '2021-09-23 10:01:47', 'Product'),
(1203, 43, 'sp', 'description', 'Muchos jardineros quieren cultivar manzanas, pero pueden ser dif&iacute;ciles de cultivar bien porque los manzanos son propensos a muchos problemas de insectos y enfermedades. Aunque los nuevos cultivares se crearon para que fueran resistentes, todav&iacute;a requieren algunos m&eacute;todos de fumigaci&oacute;n, cobertura u otros m&eacute;todos de protecci&oacute;n. Los manzanos tambi&eacute;n necesitan una gran poda. Al podar, conc&eacute;ntrese en adelgazar las ramas para aumentar la cantidad de luz solar y el flujo de aire que puede llegar a todas las partes del &aacute;rbol. Esto promueve un crecimiento saludable y ayuda a prevenir enfermedades.', '2021-09-15 04:27:07', '2021-09-23 10:01:47', 'Product'),
