(1207, 44, 'en', 'description', '<p>White button mushrooms are&nbsp;small to medium in size&nbsp;with caps averaging 2-7 centimeters in diameter and are attached to short, truncated stems. ... When raw, White button mushrooms are mild with a crisp texture, and when cooked, they develop an earthy flavor with a tender, chewy texture.</p>', '2021-09-15 04:36:41', '2021-09-15 04:36:41', 'Product'),
