(1211, 44, 'ar', 'description', '<p>فطر الزر الأبيض صغير إلى متوسط الحجم مع أغطية يبلغ متوسط قطرها من 2 إلى 7 سم ، وهي متصلة بسيقان قصيرة مقطوعة. ... عندما يكون الفطر الأبيض الخام خفيفًا مع ملمس هش ، وعندما ينضج ، يكتسب نكهة ترابية مع ملمس طري ومضغ.</p>', '2021-09-15 04:36:41', '2021-09-15 04:36:41', 'Product'),
