(1215, 44, 'sp', 'description', '<p>Los champi&ntilde;ones blancos son de tama&ntilde;o peque&ntilde;o a mediano con tapas que promedian entre 2 y 7 cent&iacute;metros de di&aacute;metro y est&aacute;n adheridas a tallos cortos y truncados. ... Cuando est&aacute;n crudos, los champi&ntilde;ones blancos son suaves con una textura crujiente, y cuando se cocinan, desarrollan un sabor terroso con una textura tierna y masticable.</p>', '2021-09-15 04:36:41', '2021-09-15 04:36:41', 'Product'),
