(1219, 45, 'en', 'description', '<p>A rich flavored, meaty textured mushroom, which has a large, flat, dark brown cap that grows up to 5 inches in diameter when mature. Also known by its scientific name, agaricus bisporus, this mushroom is delicious when grilled, broiled, or saut&eacute;ed, providing a somewhat smokey or earthy flavor.</p>', '2021-09-15 04:46:45', '2021-09-15 04:46:45', 'Product'),
