(1239, 46, 'sp', 'description', '<p>Cantharellus cinnabarinus La palabra griega que significa taza / jarra o recipiente para beber (o Cinnabar Red Chanterelle-) es un hongo originario del este de Am&eacute;rica del Norte. Es un miembro del g&eacute;nero Cantharellus junto con otros rebozuelos. Lleva el nombre de su color rojo, que es impartido por el carotenoide cantaxantina.</p>', '2021-09-15 05:02:20', '2021-09-15 05:02:20', 'Product'),
