(1250, 47, 'sp', 'name', 'Cantharellus enelensis', '2021-09-15 05:17:54', '2021-09-15 05:17:54', 'Product'),
(1251, 47, 'sp', 'description', '<p>Cantharellus enelensis tiene crestas decurrantes que se bifurcan, un casquete que mide entre 2,5 y 11 cm de di&aacute;metro y puede ser infundibuliforme en los ejemplares m&aacute;s viejos. La pulpa es firme y de color blanco a amarillo p&aacute;lido en el interior y puede oler afrutado, a menudo descrito como olor a albaricoque. El pie del hongo se ensancha al acercarse al sombrero.</p>', '2021-09-15 05:17:54', '2021-09-15 05:17:54', 'Product'),
(1252, 47, 'sp', 'meta_keyword', 'Cantharellus enelensis', '2021-09-15 05:17:54', '2021-09-15 05:17:54', 'Product'),
