(1270, 49, 'ar', 'name', 'فطر إينوكي', '2021-09-15 05:42:08', '2021-09-15 05:42:08', 'Product'),
(1271, 49, 'ar', 'description', '<p>يُعرف أيضًا بالنمو في مجموعات طويلة من السيقان الشبيهة بالخيوط التي تنبت قبعات بيضاء صغيرة. ... يقدم الفطر نكهة خفيفة مع قوام مقرمش إلى حد ما. إنه إضافة جيدة للسلطات والشوربات وأطباق اللحوم وكمقبلات.</p>', '2021-09-15 05:42:08', '2021-09-15 05:42:08', 'Product'),
