(1274, 49, 'sp', 'name', 'Hongos Enoki', '2021-09-15 05:42:08', '2021-09-15 05:42:08', 'Product'),
(1275, 49, 'sp', 'description', '<p>Tambi&eacute;n conocido como el hongo Snow Puff, Velvet Foot y Enokitaki, el Enoki crece en grupos largos de tallos en forma de cuerda de los que brotan peque&ntilde;as tapas blancas. ... Las setas aportan un sabor suave con una textura algo crujiente. Es un buen complemento para ensaladas, sopas, platos de carne y como guarnici&oacute;n.</p>', '2021-09-15 05:42:08', '2021-09-15 05:42:08', 'Product'),
