(1, 1, 195, 'The food at Hatsuhana Sushi Restaurant is exceptional! Very tasty and well prepared and you can chose among many menu options. I love the service at the place and the chef is so friendly with the guests and always takes care to offer the best quality! I highly recommend this place.', 223, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(2, 1, 200, 'Delicious high quality plates, selection of wines and great service.\r\nWe tried all their entrees, one of their desserts, and everything was de-li-cious. Highly recommended.', 219, '2', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(3, 1, 195, 'I really liked the quality , the products were fresh.', 219, '2', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(4, 2, 196, 'The quality of the product was very good.', 213, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(5, 2, 201, ' It’s a great experience. The ambiance is very welcoming and charming. Amazing wines, food and service. Staff are extremely knowledgeable and make great recommendations.', 224, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(6, 2, 201, 'Excellent food. Menu is extensive and seasonal to a particularly high standard. Definitely fine dining. It can be expensive but worth it and they do different deals on different nights so it’s worth checking them out before you book. Highly recommended.', 223, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(7, 2, 194, 'Searching for places to eat in the local area and this place popped up. I don’t normally leave reviews but I feel compelled as the food was absolutely exquisite. The Club A Steakhouse may be the best dessert I’ve ever had! Just annoyed I had to share it.', 220, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(8, 3, 201, ' This place is great! Atmosphere is chill and cool but the staff is also really friendly. They know what they’re doing and what they’re talking about, and you can tell making the customers happy is their main priority. Food is pretty good, some italian classics and some twists, and for their prices it’s 100% worth it.', 213, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(9, 3, 195, 'Would surely recommend to others, quality was amazing.', 220, '3', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(10, 3, 194, 'Absolutely amazing! The place is beautiful and staff are super friendly and the food is delicious. I love that you get a lot of food as well for the price. It’s definitely not like other expensive restaurants and you only get a small amount of food. I am definitely going back.', 222, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(11, 3, 196, 'We are so fortunate to have this place just a few minutes drive away from home. Food is stunning, both the tapas and downstairs restaurant. Cocktails wow, wine great and lovely selection of beers. Love this place and will continue to visit.', 224, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(12, 4, 197, 'Delicious food, waiters are very attentive, and super nice atmosphere. Plus it’s all at an affordable price.\r\nCan totally recommend it and will definitely come back again.', 219, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(13, 4, 198, ' Loved this place. The atmosphere, food and most of the drinks were great. The bartenders knew their mixology and it showed in the drinks. Great place to hangout, chill or go out on a date.', 224, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
