(16, 5, 198, 'Excellent, unassuming and wonderful find. Great variety and fine value tasting menu. Exciting food with high quality presentation, service and inventiveness. A highlight of (CN). Book to avoid disappointment it’s really worth it.\r\n', 213, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
