(45, 15, 270, 'Everything about this restaurant was great. The place was clean and smelled good. The staff and greeter was very nice. Our waiter was awesome, the staff also worked as a team in bringing and cleaning up our food. The food was fresh and awesome. Then we also had dessert and that was really good as well. Great atmosphere with really nice people.', 219, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(46, 15, 266, ' This cozy restaurant has left the best impressions! Hospitable hosts, delicious dishes, beautiful presentation, wide wine list and wonderful dessert. I recommend to everyone! I would like to come back here again and again.', 224, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(47, 16, 255, 'Amazing experience! If you thought gourmet kitchen will leave you hungry, think again. You should skip several meals before visiting this amazing restaurant. Everything is so tasty, you cannot restraint yourself from having all of the dishes.', 219, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(48, 16, 270, 'Absolutely amazing! The place is beautiful and staff are super friendly and the food is delicious. I love that you get a lot of food as well for the price. It’s definitely not like other expensive restaurants and you only get a small amount of food. I am definitely going back.', 220, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(49, 16, 270, ' Delicious high quality plates, selection of wines and great service.\r\nWe tried all their entrees, one of their desserts, and everything was de-li-cious. Highly recommended.', 223, '3', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(50, 16, 270, 'The food at Crabcake is exceptional! Very tasty and well prepared and you can chose among many menu options. I love the service at the place and the chef is so friendly with the guests and always takes care to offer the best quality! I highly recommend this place.', 224, '4', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
(51, 17, 255, 'It’s a great experience. The ambiance is very welcoming and charming. Amazing wines, food and service. Staff are extremely knowledgeable and make great recommendations.', 213, '5', '1', '0', '2021-12-20 11:45:56', '2021-12-20 11:45:56'),
